    true,nt"url": null,nt"notes": "In January and February 2003, the Airborne
    Second Generation Precipitation Radar (APR-2) collected data in the Wakasa Bay AMSR-E
    validation campaign over the sea of Japan on board a NASA P-3 aircraft. Data were
    collected on all P-3 flights that encountered precipitation. APR-2 collected data
    at 13.405 and 35.605 GHz in a downward-looking, cross-track scanning geometry. The
    experiment was designed to validate the AMSR-E shallow rain and snow retrievals,
    and to extend the precipitation database needed to implement a physical validation
    strategy.nnThe Level 1 data product consists of the calibrated reflectivity at both
    13.405 and 35.605 GHz, as well as the Doppler and linear depolarization ratio (LDR)
    at 13.405 GHz. Data are available via FTP in binary Hierarchical Data Format (HDF)
    and browse images.nnThe Advanced Microwave Scanning Radiometer - Earth Observing
    System (AMSR-E) is a mission instrument launched aboard NASA's Aqua Satellite on
    4 May 2002. AMSR-E validation studies linked to rainfall experiments are designed
    to evaluate the accuracy of AMSR-E precipitation data.",nt"license_title":
